    false,nt"url": null,nt"notes": "This narrative report for Wheeler NWR outlines
    Refuge accomplishments from September through December of 1955. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    Resource management is outlined; topics include grazing, haying, fur harvesting,
    and timber removal. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, fishing, and violations. Items
    of interest, N-R forms, and photographs are attached.",nt"license_title": "License
